type BtnProps = { children: React.ReactNode; };

const Primary = (props: BtnProps) => {
    return (
        <button
            style={{
                border: '3px solid var(--white)',
                color: 'var(--white)',
                background: 'var(--blue)',
                padding: '13px 25px',
                margin: '10px 50px',
                fontSize: '19px'
            }}
        >{props.children}</button>
    );
};

const Secondary = (props: BtnProps) => {
    return (
        <button
            style={{
                border: '3px solid var(--blue)',
                color: 'var(--blue)',
                background: 'var(--white)',
                padding: '10px 25px',
                fontSize: '19px'
            }}
        >{props.children}</button>
    );
};

